  "text" : "\uB098\uB294 \uADF8\uB0E5 \uC885\uC774\uCEF5 \uBE44\uB2D0\uD3EC\uC7A5\uC744 \uB72F\uC744 \uB54C, \uB9C8\uC2DC\uB294 \uBD80\uBD84 \uCABD\uC73C\uB85C \uB72F\uC5B4\uB193\uACE0 \uBCF4\uAD00\uD558\uBA74 \uCEF5 \uC548\uC5D0 \uBA3C\uC9C0\uAC00 \uB4E4\uC5B4\uAC00\uB2C8\uAE4C \uADF8\uAC78 \uB2E4\uC2DC \uAEBC\uB0B4\uC11C \uCEF5 \uBC11\uBC14\uB2E5 \uCABD\uC774 \uC678\uBD80\uB97C \uD5A5\uD558\uAC8C \uD574\uB193\uC558\uC744 \uBFD0\uC778\uB370, \uADF8\uAC70 \uC815\uB9AC\uD588\uB2E4\uACE0 \"\uB108 \uAC8C\uC774\uC57C? \uB2E4\uB978 \uB0A8\uC790\uB4E4\uC740\u2026\" \uC774\uB77C\uB294 \uC18C\uB9AC\uB97C \uB4E4\uC73C\uBA74 \uAE30\uBD84 \uB098\uC058\uC9C0",
