  "text" : "\uC774\uB7EC\uD55C \uACE0\uBBFC\uC740 \uAC00\uC871\uC5D0\uAC8C\uB3C4 \uB9D0\uD558\uC9C0 \uBABB\uD588\uACE0, \uB3D9\uB8CC- \uC2EC\uC9C0\uC5B4\uB294 \uD568\uAED8 \uD615 \uC9D1\uD589\uC5D0 \uCC38\uC5EC\uD588\uB358 \uB3D9\uB8CC\uB07C\uB9AC\uB3C4 \uD615 \uC9D1\uD589\uACFC \uADF8\uB85C \uC778\uD55C \uC2A4\uD2B8\uB808\uC2A4\uC5D0 \uB300\uD574 \uB300\uD654\uD558\uAE30\uB97C \uAEBC\uB824\uD558\uB294 \uBAA8\uC2B5\uC744 \uBCF4\uC784. \uADF8\uB0E5 \uC628\uC804\uD788 \uAC1C\uC778\uC774 \uD574\uACB0\uD574\uC57C \uD560 \uBB38\uC81C\uB85C \uB0A8\uC74C\u2026 http:\/\/t.co\/Tm8LpkZKF2",
