  "text" : "\uD615 \uC9D1\uD589\uC5D0 \uCC38\uC5EC\uD588\uB358 \uB3D9\uB8CC \uB610\uB294 \uC790\uC2E0\uC758 \uC8FC\uBCC0\uC778\uB4E4\uC5D0\uAC8C \uB2E5\uCE5C \uAC11\uC791\uC2A4\uB7F0 \uC0AC\uACE0 \uB4F1\uC758 \uBD88\uD589\uC774 '\uC0AC\uD615 \uC9D1\uD589\uC5D0 \uCC38\uC5EC\uD588\uAE30 \uB54C\uBB38\uC5D0 \uADF8\uB7F0 \uAC83 \uC544\uB2D0\uAE4C' \uD558\uB294 \uB9C9\uC5F0\uD55C \uB450\uB824\uC6C0\uC5D0 \uC2DC\uB2EC\uB9AC\uACE0 \uC788\uB294 \uAC83\uB3C4 \uAD00\uCC30\uB428. \uBB38\uC81C\uB294 \uC774\uB7EC\uD55C \uC2A4\uD2B8\uB808\uC2A4\uB97C \uC8FC\uBCC0\uC5D0 \uD138\uC5B4\uB193\uC9C0 \uBABB\uD558\uACE0, \uD63C\uC790\uB9CC\uC758 \uACE0\uBBFC\uC73C\uB85C\u2026",
