  "text" : "'\uD615\uC744 \uC9D1\uD589\uD558\uB294 \uB0A0\uC5D0\uB294 \uC9D1\uC5D0 \uB4E4\uC5B4\uAC00\uBA74 \uC548\uB41C\uB2E4' \uB77C\uAC70\uB098 '\uD615\uC9D1\uD589 \uC218\uB2F9\uC744 \uBAB8\uC5D0 \uC9C0\uB2C8\uACE0 \uC788\uC73C\uBA74 \uC548\uB41C\uB2E4' \uB77C\uB294 \uC0DD\uAC01\uC744 \uAC00\uC9C0\uACE0 \uBC24\uC0C8\uB3C4\uB85D \uC220\uC744 \uB9C8\uC2DC\uBA70 \uAD34\uB85C\uC6CC\uD558\uAE30\uB3C4 \uD558\uACE0, \uC790\uC2E0\uC774 \uC0AC\uD615 \uC9D1\uD589\uC5D0 \uCC38\uC5EC\uD588\uB358 \uC0AC\uD615\uC7A5\uC774\uB098 \uC0AC\uD615\uC218\uB3D9\uC744 \uC9C0\uB0A0 \uB54C\uB9C8\uB2E4 \uADF8 \uD2B8\uB77C\uC6B0\uB9C8\uB85C \uC778\uD574 \uAD34\uB85C\uC6CC\uD558\uBA70",
