  "text" : "\uC0AC\uD615\uC9D1\uD589\uC5D0 \uCC38\uC5EC\uD55C \uAD50\uB3C4\uAD00\uB4E4\uC740, \uADF8 \uACFC\uC815 \uC804\uBC18\uC5D0 \uC0C1\uB2F9\uD55C \uCDA9\uACA9\uC744 \uBC1B\uC74C. \uC0AC\uD615 \uC9D1\uD589\uC744 \uC900\uBE44\uD558\uB294 \uB2E8\uACC4\uBD80\uD130 \uC5B4\uB824\uC6C0\uC744 \uB290\uB07C\uAC70\uB098, \uC544\uB2C8\uBA74 \uAC00\uC871\uC774\uB098 \uC9C0\uC778\uC758 \uC784\uC885 \uB2F9\uC2DC \uBC1B\uC558\uB358 \uCDA9\uACA9\uC744 \uB290\uB07C\uB294 \uACBD\uC6B0\uB3C4 \uC788\uACE0, \uC0AC\uD615 \uC9D1\uD589 \uB3C4\uC911\uC5D0\uB098 \uADF8 \uC774\uD6C4\uC5D0 \uC2A4\uD2B8\uB808\uC2A4\uB85C \uC778\uD574 \uAD6C\uD1A0\uD558\uB294 \uACBD\uC6B0\uB3C4\u2026",
