  "text" : "\uD53C\uACE0\uC778\uC5D0\uAC8C \uC0AC\uD615\uC744 \uACE0\uB824\uD560 \uB54C, \uBC95\uAD00\uC774 '\uB0B4 \uD310\uB2E8\uC73C\uB85C \uC778\uD574 \uC0AC\uB78C\uC774 \uC8FD\uB294\uB2E4'\uB294 \uAC83\uC73C\uB85C \uC5BC\uB9C8\uB098 \uB9CE\uC740 \uC778\uAC04\uC801 \uACE0\uBBFC\uC744 \uD558\uBA70, \uACE0\uBBFC \uB05D\uC5D0 \uC0AC\uD615\uC744 \uACB0\uC815\u00B7\uC120\uACE0\uD560 \uB54C\uC5D0\uB3C4 \uD53C\uACE0\uC778\uC758 \uB208\uC744 \uC81C\uB300\uB85C \uCCD0\uB2E4\uBCF4\uC9C8 \uBABB\uD55C\uB2E4\uB358\uAC00, \uADF8 \uC774\uD6C4\uC5D0\uB3C4 \uC790\uC2E0\uC758 \uD310\uB2E8\uC758 \uB2F9\uC704\uC131 \uC758\uBB38\uC5D0 \uACE0\uBBFC\uD55C\uB2E4\uB358\uAC00\u2026",
