  "text" : "\uCDA9\uC2E4\uD574\uC57C \uD558\uACE0, \uC0AC\uD68C\uC801 \uC57D\uC790 \uBC0F \uC18C\uC218\uC790\uC5D0 \uB300\uD55C \uAD00\uC2EC\uC774 \uC694\uAD6C\uB418\uBA70, \uBD80\uB2F9\uD558\uAC8C \uD655\uB300\uB418\uC5B4 \uD589\uC0AC\uB418\uB294 \uAD6D\uAC00\uD615\uBC8C\uAD8C\uB825\uC744 \uACAC\uC81C\uD558\uB294 \uC5ED\uD560\uC5D0 \uCDA9\uC2E4 \uD574\uC57C \uD558\uACE0, \uC7AC\uD310\uC758 \uD615\uD3C9\uC131 \uBCF4\uC7A5\uC5D0 \uC2E0\uACBD \uC4F0\uBA70, \uC7AC\uD310\uC758 \uC124\uC2DC\uC5D0 \uC788\uC5B4\uC11C \uD53C\uACE0\uC778\uC774\uB098 \uC77C\uBC18\uAD6D\uBBFC\uC744 \uC124\uB4DD\uD560 \uC218 \uC788\uB3C4\uB85D \uB17C\uC99D\uC758 \uD569\uB9AC\uC131\uACFC",
