  "text" : "\uC2DC\uB300\uC5D0 \uB530\uB77C \uC0C1\uD669\uC5D0 \uB530\uB77C \uBC95\uB960\uD574\uC11D\uACFC \uC801\uC6A9\uC774 \uB2EC\uB77C\uC9C8 \uC218 \uC788\uB294 \uAC83\uC774 \uC544\uB2C8\uB2E4. \uACFC\uAC70 \uC5B4\uB290 \uB300\uBC95\uC6D0\uC7A5\uC758 \uB9D0\uCC98\uB7FC \uAD6D\uAC00\uC548\uC704\uB97C \uC704\uD574\uC11C\uB77C\uBA74 \uBC95\uB960\uD574\uC11D\uC774 \uB2EC\uB77C\uC9C8 \uC218\uB3C4 \uC788\uB294 \uAC83\uC774 \uC544\uB2C8\uB2E4. \uCC45\uC784\uC8FC\uC758, \uC8C4\uD615\uBC95\uC815\uC8FC\uC758 \uB4F1 \uBC95\uCE58\uAD6D\uAC00\uC774\uB150\uC5D0\uC11C \uB3C4\uCD9C\uB418\uB294 \uD5CC\uBC95\uC0C1 \uAE30\uBCF8\uC6D0\uB9AC\uC640 \uD615\uBC95\uC774\uB860\uC5D0 \uBCF4\uB2E4",
