  "text" : "\uADFC\uB370 \uB098\uB294 \uB098\uB984 \uB9E4\uB108\uB78D\uC2DC\uACE0 \uBE14\uB77D\uC744 \uD55C \uB4A4 \uD480\uC5B4\uC11C \uC5B8\uD314\uC774 \uB41C\uAC74\uB370, \uADFC\uC131\uC744 \uAC00\uC9C0\uACE0(?) \uACC4\uC18D \uD314\uB85C\uC789\uC744 \uD574\uC624\uB294 \uBD84\uB4E4\uC774 \uC788\uC74C. \uADF8\uB7F0 \uBD84\uB4E4\uC740 \uB9CE\uAC8C\uB294 \uBA87 \uC8FC\uC529 \uB9E4\uC77C\uAC19\uC774 \uB2E4\uC2DC \uD314\uB85C\uC789\uC744 \uD574\uC624\uC2DC\uAC70\uB098 \uB9AC\uC2A4\uD2B8\uC5D0 \uB098\uB97C \uC9D1\uC5B4\uB123\uB294\uB370, \uADF8 \uB54C\uB294 \uC815\uB9D0 \uC18C\uB984\uB07C\uCCD0\uC11C \uBE14\uB77D\uD558\uACE0 \uC2F6\uAE30\uB3C4\u2026",
