  "text" : "\uB098\uB294 \uC194\uAE4C\uB9D0.. \uD3C9\uC18C \uB098\uC640 \uC544\uBB34\uB7F0 \uAD50\uB958\uB3C4 \uC5C6\uB294\uB370, \uB0B4 \uD0C0\uC784\uB77C\uC778\uC744 \uC8FC\uAE30\uC801\uC73C\uB85C \uB610\uB294 \uD2B9\uC815 \uC2DC\uAC04\uB9C8\uB2E4 \uB9C8\uCE58 \uBCF5\uC0AC\uB77C\uB3C4 \uD574\uAC00\uB4EF\uC774 \uC6B0\uB974\uB974 \uB9AC\uD2B8\uC717 \uB610\uB294 \uAD6C\uC54C\uD2F0 \uD574\uAC00\uB294 \uC0AC\uB78C\uB4E4\uC774 \uBB34\uCC99 \uC2E0\uACBD \uC4F0\uC784. \uB9CC\uC57D \uADF8 \uBD84\uB4E4\uC758 \uD0C0\uC784\uB77C\uC778\uC774 \uB9AC\uD2B8\uC717 \uC704\uC8FC\uB85C\uB9CC \uCC44\uC6CC\uC838 \uC788\uB2E4\uBA74 \uADF8\uB0E5 \uB9E4\uB108\uBE14\uC5B8\uD314",
