  "text" : "\u2026\uB2E4\uC2DC \uD55C \uBC88 \uBC18\uBCF5\uD558\uC9C0\uB9CC, \uBC94\uC8C4\uD589\uC704\uAC00 \uAD1C\uCC2E\uB2E4\uAC70\uB098 \uC774\uB97C \uAD00\uB300\uD788 \uCC98\uBC8C\uD558\uC790\uB294 \uCDE8\uC9C0\uB85C \uB9D0\uD558\uB294 \uAC83\uC774 \uACB0\uCF54 \uC544\uB2C8\uB2E4. \uB2E4\uB9CC, \uD2B9\uC815\uD55C \uBC94\uC8C4\uC5D0 \uB300\uD55C \uACFC\uB3C4\uD55C \uAC10\uC815\uC801 \uB300\uC6A9\uC740 \uACB0\uAD6D \uC2DC\uAC04\uC774 \uC9C0\uB09C \uD6C4 \"\uC624\uC9C1 \uBA87\uBA87 \uACBD\uC6B0\uC5D0\uB9CC \uC801\uC6A9\uB420 \uC218 \uC788\uB294 \uBE44\uD6A8\uC728\uC801\uC778 \uBC95\"\uC73C\uB85C \uB0A8\uAC8C \uB41C\uB2E4\uB294 \uC0AC\uC2E4\uC744",
