  "text" : "\uC9C0\uAE08\uC740 \uC544\uB3D9\uC744 \uB300\uC0C1\uC73C\uB85C \uD55C \uD559\uB300\uB098 \uC131\uBC94\uC8C4\uAC00 \uBB38\uC81C\uC774\uC9C0\uB9CC, \uD615\uBC8C \uD3EC\uD4F0\uB9AC\uC998\uC758 \uB300\uC0C1\uC740 \uB54C\uC5D0 \uB530\uB77C \uC5BC\uB9C8\uB4E0\uC9C0 \uBC14\uB014 \uC218 \uC788\uB2E4. 1980\uB144\uB300 \uC774\uD6C4 \uC11C\uC591 \uC5EC\uB7EC \uB098\uB77C\uC5D0\uC11C \uBB38\uC81C\uB418\uC5C8\uB358 \uB9C8\uC57D \uBC94\uC8C4\uB098 2000\uB144\uB300 \uC774\uD6C4 \uC0C8\uB86D\uAC8C \uB4F1\uC7A5\uD55C \uD14C\uB7EC \uBC94\uC8C4\uAC00 \uC88B\uC740 \uBCF4\uAE30\uAC00 \uB420 \uAC83\uC774\uB2E4.",
