  "text" : "\u2026 \uC0AC\uC2E4 \uC6B0\uB9AC \uC0AC\uD68C\uC5D0\uC11C \uC774\uC640 \uAC19\uC740 \uD615\uBC8C\uC758 \uAC15\uD654\uB294 \uC804\uD600 \uC0C8\uB85C\uC6B4 \uD604\uC0C1\uB3C4 \uC544\uB2C8\uB2E4. \uAD70\uC0AC\uC815\uAD8C \uC2DC\uC808, \uAC15\uC81C\uB41C(?) \uC5EC\uB860\uC744 \uBC30\uACBD\uC73C\uB85C '\uC0AC\uD68C\uC9C8\uC11C'\uB97C \uAC15\uC870\uD558\uBA70 \uC9C4\uD589\uB418\uC5C8\uB358 \uC0AC\uD68C \uBD80\uB791\uC778\uB4E4\uC758 \uB2E8\uC18D, \uC544\uC9C1\uB3C4 \uADF8 \uD53C\uD574\uAC00 \uC644\uC804\uD788 \uC544\uBB3C\uC9C0 \uC54A\uC740 '\uC0BC\uCCAD\uAD50\uC721\uB300 \uC0AC\uAC74' \uB4F1\uB3C4 \uD06C\uAC8C \uBCF4\uBA74",
