  "text" : "\uC800\uB3C4 \uACF5\uBD80 \uD560 \uB54C \uC2DC\uAC04\uC744 \uC7AC\uBA74\uC11C \uACF5\uBD80\uB97C \uD558\uB294 \uC2A4\uD0C0\uC77C. \uCC98\uC74C\uC5D0\uB294 \uC2A4\uD0D1\uC6CC\uCE58\uB85C \uC2DC\uAC04\uC744 \uC7AC\uB2E4\uAC00, \uC2A4\uB9C8\uD2B8\uD3F0\uC774 \uB4F1\uC7A5\uD558\uBA74\uC11C \uC88B\uC740 \uC5B4\uD50C\uB4E4\uC774 \uB9CE\uAE38\uB798 \uADF8\uAC78 \uAE54\uC544\uC11C \uC37C\uACE0, \uADF8 \uBC84\uB987\uC774 \uC9C0\uAE08\uAE4C\uC9C0\uB3C4 \uB0A8\uC544\uC11C \uB9E4\uC77C\uB9E4\uC77C \uC218\uBA74\uC2DC\uAC04\uAE4C\uC9C0 \uC5B4\uD50C\uB85C \uCE21\uC815\uD558\uACE0 \uC788\uB2E4\uB294 \uAC83\uC774 \uD568tothe\uC815..",
