  "id_str" : "533164119298293760",
  "text" : "RT @noamzin: \uC774\uAC78 \uB9E4\uC77C \uB4E4\uC5EC\uB2E4 \uBCF4\uBA74, \uC2A4\uC2A4\uB85C \uD55C\uC2EC\uD558\uAE30\uB3C4 \uD558\uACE0 \uADF8\uB798. \uBD84\uBA85 \uD558\uB8E8\uC885\uC77C \uACF5\uBD80\uD55C \uC904 \uC54C\uC558\uB294\uB370, \uCC0D\uD788\uB294 \uC2DC\uAC04\uC774 3\uC2DC\uAC04\uC774 \uC548\uB418\uB294 \uAC70\uC57C? \uB418\uAC8C \uC5B4\uC774 \uC5C6\uC5C8\uB2E4. \uADF8\uB807\uAC8C \uC2DC\uAC04\uC744 \uAD00\uB9AC\uD558\uB2E4\uBCF4\uB2C8, \uC2DC\uD5D8 \uB9C9\uD310\uC5D4 11\uC2DC\uAC04\uC529 \uCC0D\uACE0 \uADF8\uB7AC\uC5C8\uB2E4. \uB418\uAC8C \uB3C4\uC6C0\u2026",
