  "text" : "\uC774\uAC8C \uB300\uBC95\uC6D0 \uC591\uD615\uC758\uC6D0\uD68C\uC5D0\uC11C \uC815\uD55C \uC131\uBC94\uC8C4 \uC591\uD615\uAE30\uC900\uC758 \uC77C\uBD80\uC778\uB370, \uB300\uCDA9 \uC0B4\uD3B4\uBD10\uB3C4 \uADF8\uB3D9\uC548 \uC5B8\uB860 \uBCF4\uB3C4 \uB4F1\uC744 \uD1B5\uD574\uC11C \uC811\uD588\uB358 \uAC83\uACFC \uC880 \uB2E4\uB974\uB2E4\uB294 \uAC83\uC744 \uB290\uB084 \uC218 \uC788\uC744\uC9C0\uB3C4. \uD2B9\uD788 '\uC220\uB9CC \uB9C8\uC2DC\uBA74 \uAC10\uD615' \uC774\uB77C\uB358\uAC00... http:\/\/t.co\/bea3cME8Yx",
