  "text" : "\uAC8C\uB2E4\uAC00 \uC65C \uAC00\uD574\uC790\uC640 \uD569\uC758\uD55C \uD53C\uD574\uC790\uAE4C\uC9C0 \uC774\uC0C1\uD55C \uC0AC\uB78C\uC73C\uB85C \uB9CC\uB4E4\uB824\uACE0 \uD558\uB098. \uC2EC\uC9C0\uC5B4\uB294 \"\uD53C\uD574\uC790\uAC00 \uACBD\uC81C\uC801 \uC720\uD639\uC5D0 \uB208\uC774 \uBA40\uC5B4 \uAC00\uD574\uC790\uB97C \uC6A9\uC11C\uD558\uB294 \uBC14\uB78C\uC5D0 \uAC00\uD574\uC790\uAC00 \uC81C\uB300\uB85C \uCC98\uBC8C\uBC1B\uC9C0 \uC54A\uACE0 \uB098\uC640\uC11C \uB610 \uC131\uBC94\uC8C4\uB97C \uC800\uC9C0\uB974\uB294 \uAC83 \uC544\uB2C8\uB0D0.\" \uB77C\uB294 \uD574\uAD34\uB9DD\uCE21\uD55C \uB17C\uB9AC\uAE4C\uC9C0\u2026 (\uC5B4\uC9C8\uC5B4\uC9C8)",
