  "text" : "\uC131\uBC94\uC8C4\uC640\uB294 \uAD00\uB828\uC774 \uC5C6\uB294 \uC774\uC885\uC804\uACFC\uAE4C\uC9C0 \uC804\uBD80 \uD569\uCE5C \uC7AC\uBC94\uC728\uC744 \uC774\uC720\uB85C \uB4E4\uC5B4 \uAC10\uD615\uC744 \uB9C9\uACE0, \uCC98\uBC8C\uC744 \uAC15\uD654\uD558\uC5EC \uAC15\uAC04 \uB4F1 \uC131\uBC94\uC8C4\uC758 \uBC94\uC8C4\uC728\uC744 \uB0AE\uCD94\uB824\uACE0 \uD55C\uB2E4\uBA74, \uAD50\uD1B5\uBC94\uC8C4 \uB4F1 \uC628\uAC16 \uBC94\uC8C4\uC758 \uAC10\uD615\uC744 \uB9C9\uACE0 \uCC98\uBC8C\uC744 \uAC15\uD654\uD574\uC57C \uD568. \uADFC\uB370 \uB2D8\uB4E4\uB07C\uB9AC\uB294 \uBD88\uCCB4\uD3EC\uD2B9\uAD8C \uB9C9 \uC2F8\uC9C0\uB974\uACE0 \uADF8\uB7EC\uC796\uC544\uC5EC",
