  "text" : "\uAC8C\uB2E4\uAC00 \"\uAC10\uD615\uC744 \uD574\uC8FC\uB2C8 \uB610 \uAC15\uAC04\uC744 \uD574\uC11C \uAC15\uAC04 \uC7AC\uBC94\uC728\uC774 60% \uB118\uC5B4\uAC04\uB2E4\"\uACE0 \uD558\uB294\uB370, 2014 \uBC94\uC8C4\uBD84\uC11D(\uB300\uAC80\uCC30\uCCAD)\uC5D0 \uB530\uB974\uBA74 2013\uB144\uC5D0 \uBC1C\uC0DD\uD55C \uAC15\uAC04\uBC94\uC8C4\uC758 \uC7AC\uBC94\uC728\uC740 60.8%\uC774\uC9C0\uB9CC, \uADF8 \uC911 \uB3D9\uC885\uC804\uACFC\uC790\uC758 \uBE44\uC728\uC740 12.5% \uC218\uC900. \uB098\uBA38\uC9C0\uB294 \uB2E4 \uB2E4\uB978 \uBC94\uC8C4 \uC804\uACFC\uC790",
