  "text" : "\"\uD569\uC758\uB97C \uC704\uD55C \uC9C4\uC9C0\uD55C \uB178\uB825\uC744 \uD1B5\uD574 \uD53C\uD574\uC5D0 \uB300\uD55C \uC0C1\uB2F9\uD55C \uBCF4\uC0C1\uC774 \uC774\uB8E8\uC5B4\uC84C\uC73C\uBA70, \uD53C\uD574\uC790\uAC00 '\uCC98\uBC8C\uBD88\uC6D0'\uC758 \uBC95\uC801\u00B7\uC0AC\uD68C\uC801 \uC758\uBBF8\uB97C \uC815\uD655\uD788 \uC778\uC2DD\uD558\uBA74\uC11C \uC774\uB97C \uBC1B\uC544\uB4E4\uC5EC \uD53C\uACE0\uC778\uC758 \uCC98\uBC8C\uC744 \uC6D0\uD558\uC9C0 \uC54A\uB294 \uACBD\uC6B0\"\uC5D0\uB3C4 \uC81C3\uC790\uB4E4\uC774 \"\uD53C\uD574\uC790\uAC00 \uC6A9\uC11C\uD574\uB3C4 \uB098\uB294 \uC6A9\uC11C \uBABB\uD568\" \uD558\uB294 \uC0C1\uD669\u2026",
