  "text" : "\uB9C9\uB9D0\uC774\uB098 \uADA4\uBCC0\uC744 \uC3DF\uC544\uB0B8 \uB2E4\uC74C\uC5D0 '\uC21C\uAC04 \uAE30\uBD84\uC774 \uB098\uBE60\uC11C \uADF8\uB7AC\uB2E4.' \uB610\uB294 '\uB098\uB3C4 \uBAA8\uB974\uAC8C \uC9DC\uC99D\uC774 \uB098\uC11C \uADF8\uB7AC\uB2E4.' \uB77C\uB294 \uBCC0\uBA85\uC744 \uD1B5\uD574 \uC790\uAE30 \uB610\uB294 \uD0C0\uC778\uC744 \uD569\uB9AC\uD654 \uD558\uB824\uACE0 \uD574\uBD24\uC790 \uB354 \uAD6C\uCC28\uD574\uC84C\uC744 \uBFD0\uC774\uACE0, \uB3CC\uC544\uC624\uB294 \uAC83\uC740 \uC9C0\uCF1C\uBCF4\uB294 \uC0AC\uB78C\uB4E4\uC758 \uB0C9\uC18C\uC640 \uB354 \uB098\uBE60\uC9C4 \uC0C1\uD669 \uBFD0\uC774\uC5C8\uB2E4.",
