  "text" : "\uB098\uC640\uC11C\uB294 \uB3D9\uAE30\uB4E4\uACFC \uC11C\uB85C '\uCEAC~ \uC7BC\uC788\uC5C8\uB2E4. \uBCC4\uAC70 \uC544\uB2C8\uB354\uB77C. \uB610 \uB358\uC838\uBCF4\uACE0 \uC2F6\uB2E4.' \uBB50 \uC774\uB7F0 \uD5C8\uC138\uB97C \uC8FC\uACE0\uBC1B\uC558\uB294\uB370, \uC194\uAE4C\uB9D0 \uB610\uB2E4\uC2DC \uB358\uC838\uBCF4\uACE0 \uC2F6\uC9C0\uB294 \uC54A\uC558\uC74C; \uAD70\uBCF5\uBB34 \uD558\uBA74\uC11C \uC2E4\uCD1D\uC740 \uC3D8\uB77C\uACE0 \uADF8\uB7EC\uBA74 \uC644\uC804 \uC2E0\uB098\uC11C \uC3F4\uB314\uB294\uB370, \uC218\uB958\uD0C4\uC740 \uAE30\uD68C\uAC00 \uC788\uC5B4\uB3C4 \uC548\uB358\uC84C\uC744 \uB4EF -,.-",
