  "text" : "\uADF8\uB0E5 \uC18C\uB300\uC7A5 \uC785\uB9CC \uBCF4\uBA74\uC11C \uAC70\uAE30\uC5D0 \uB9DE\uCDB0\uC11C \uACE0\uAC1C \uB044\uB355\uB044\uB355\uD558\uACE0,  \uC808\uCC28\uC5D0 \uB530\uB77C \uC548\uC804\uD540\uC744 \uBF51\uC740 \uB4A4 \uC2E0\uD638\uAC00 \uB098\uC790\uB9C8\uC790 \uB0C5\uB2E4 \uC9D1\uC5B4\uB358\uC9C0\uACE0\uB294 \uD638 \uC548\uC73C\uB85C \uC228\uC74C(\uC0AC\uC2E4 \uB2F9\uC2DC \uAE30\uC5B5\uB3C4 \uC774\uC0C1\uD558\uAC8C \uAC00\uBB3C\uAC00\uBB3C)..\n\n\uADF8\uB9AC\uACE0 \uC7A0\uC2DC \uD6C4 \uB4E4\uB824\uC628 \uD3ED\uBC1C\uC74C\uC744 \uB4E3\uACE0 \uB098\uC11C\uC57C \uC815\uC2E0\uC774 \uC880 \uB4E4\uB354\uB77C \u314E\u314E",
