  "text" : "\uD638 \uC548\uC5D0 \uB4E4\uC5B4\uAC14\uB354\uB2C8 \uBA3C\uC9C0\uB97C \uB4A4\uC9D1\uC5B4 \uC4F4 \uC18C\uB300\uC7A5\uC774 \uC218\uB958\uD0C4\uC744 \uB0B4 \uC190\uC5D0 \uC950\uC5B4\uC8FC\uACE0\uB294 \uB0B4 \uC190\uACFC \uC218\uB958\uD0C4\uC744 \uB9DE\uBD99\uC7A1\uACE0 \uBB50\uB77C\uBB50\uB77C \uD558\uB294\uB370, \uC194\uAE4C\uB9D0 \uADC0\uC5D0 \uD558\uB098\uB3C4 \uC548\uB4E4\uC5B4\uC654\uC74C; \uADF8\uC800 \uB0B4 \uBA38\uB9BF\uC18D\uC5D0\uB294 \uC2E4\uD22C\uCC99 \uC804\uB0A0 \uD6C8\uB828 \uB2F9\uC2DC \uB0B4 \uC190 \uC548\uC5D0\uC11C \uC624\uD3ED\uBC1C\uD588\uB358 \uC5F0\uC2B5\uC6A9 \uC218\uB958\uD0C4 \uC0DD\uAC01\uB9CC \uBC45\uAE00\uBC45\uAE00\u2026",
