  "text" : "\uACFC\uC7A5 \uC880 \uBCF4\uD0DC\uC790\uBA74 \uD22C\uCC99\uC7A5\uC5D0\uC11C \uAC70\uC758 100\uC5EC \uBBF8\uD130 \uB5A8\uC5B4\uC9C4 \uB300\uAE30\uC7A5\uC5D0\uC11C\uB3C4 \uC218\uB958\uD0C4 \uD3ED\uBC1C\uB85C \uB545\uC6B8\uB9BC\uC744 \uB290\uB084 \uC218 \uC788\uC5B4\uC11C, \uB4E4\uC5B4\uAC00\uAE30 \uC9C1\uC804\uAE4C\uC9C0 \uC815\uB9D0 \uAE34\uC7A5 \uB9CE\uC774 \uD588\uC74C. \uB0B4 \uCC28\uB840\uAC00 \uB418\uC5B4 \uC870\uAD50\uB4E4\uC774 \uBC29\uD0C4\uC870\uB07C\uB97C \uC785\uD600\uC8FC\uB294\uB370, \uBA38\uB9BF\uC18D\uC774 \uBA4D~ \uD574\uC9C0\uBA74\uC11C \uC544\uBB34 \uC0DD\uAC01\uB3C4 \uC548\uB098\uB354\uB77C \u314E\u314E;;",
