  "text" : "\uAD50\uC7A5\uC5D0 \uB4E4\uC5B4\uAC04 \uB098\uB294, \uC0C1\uC0C1\uD588\uB358 \uAC83\uACFC\uB294 \uB108\uBB34 \uB2E4\uB978 \uC218\uB958\uD0C4\uC758 \uC704\uB825\uC5D0 \uAE5D\uB180\u2026 \uC601\uD654\uC5D0\uC11C\uB294 \uADF8\uB0E5 \uAF5D! \uD558\uACE0 \uD654\uC5FC\uACFC \uC5F0\uAE30\uB97C \uB0B4\uBA70 \uD130\uC9C0\uB358\uB370, \uC2E4\uC81C\uB85C\uB294 \uC815\uB9D0\uC774\uC9C0 \uACF5\uAE30\uB97C '\uCC22\uC5B4\uBC1C\uAE30\uB294' \uB290\uB08C\uC758 \uD3ED\uC74C\uACFC \uD568\uAED8 \uB545\uC774 \uBBF8\uC138\uD558\uAC8C \uC9C4\uB3D9\uC744 \uD568. \uADF8\uB9AC\uACE0 \uD654\uC5FC\uC774\uB098 \uC5F0\uAE30\uB3C4 \uBCC4\uB85C \uC5C6\uB354\uB77C\uACE0",
